import React from "react";

const Projects = () => {
  return (
    <div className="projects">
      <button
        className="btn-neon"
        href="https://marcelachuqi.github.io/Rick-and-Morty/#/ "
      >
        <img src="../src/image/MARCELA YAMUR (1).png" />
      </button>
      <a href="https://marcelachuqi.github.io/Rick-and-Morty/#/ ">
        Rick and Morty
      </a>
    </div>
  );
};

export default Projects;
